import React from "react";
import Login from "./Project3/Login";
import Home from "./Project3/Home";
import Logo from "./Project3/Logo";
import { Route, Routes } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <Logo />
      <Login />
      <Routes>
        <Route path="/Home" element={<Home />} />
      </Routes>
    </div>
  );
}
export default App;
